  (mkAufgabe5Tb_instance->INST_dut_pinData.set_clk_0)("CLK");
  (mkAufgabe5Tb_instance->INST_start_wire.set_clk_0)("CLK");
  (mkAufgabe5Tb_instance->INST_start_reg_2.set_clk_0)("CLK");
